const { Table, Column } = ReactVirtualized;
const generateRandomItem = (idx) => ({
  id: idx,
  name: faker.name.findName(),
  email: faker.internet.email(),
});

export class MisTarjetas extends React.Component {
  constructor() {
    super();
    // fake data
    let items = [];
    for (let i = 0, l = 1000; i < l; i++) {
      items.push(generateRandomItem(i));
    }
    this.state = {
      items: items,
    };
  }

  render() {
    return (
      <div class="container">
        <h1>Table example </h1>
        <Table
          rowClassName="table-row"
          headerHeight={40}
          width={600}
          height={300}
          rowHeight={40}
          rowCount={this.state.items.length}
          rowGetter={({ index }) => this.state.items[index]}
        >
          <Column label="Id" dataKey="id" width={50} />
          <Column label="Name" dataKey="name" width={250} />
          <Column label="E.mail" dataKey="email" width={300} />
        </Table>
      </div>
    );
  }
}

export default Mistarjetas;
